impl std::default::Default for AOParams {
    fn default() -> Self {
        AOParams {
            kernel_size: 16,
            radius: 0.5,
            bias: 0.025,
            power: 1.0,
            samples: Self::DEFAULT_SAMPLES,
        }
    }
}

/// Pipeline management for rendering to the ambient occlusion map of a [`crate::cone::GeometryBuffer`]
#[derive(Debug, Clone)]
pub struct AORenderer {
    /// Calculating ambient occulsion from geometry
    pub pipeline: gfx::ReflectedGraphics,
    /// map from (width, height) to Texture
    pub buf_textures: Arc<Mutex<HashMap<(u32, u32), gfx::GTexture2D>>>,
    /// map from (GeometryBuffer, Camera) to Bundle
    pub bundles: Arc<Mutex<HashMap<(u64, u64), gfx::Bundle>>>,
    pub noise_sampler: gpu::Sampler,
    pub noise_texture: gfx::GTexture2D,
    pub uniform: gfx::Uniform<AOParams>,
    pub blur_renderer: GaussBlurRenderer,
    name: Option<String>,
}

